Comparison for two `UniqueRc`s.

The two are compared by calling `cmp()` on their inner values.

# Examples

```
#![feature(unique_rc_arc)]
use std::rc::UniqueRc;
use std::cmp::Ordering;

let five = UniqueRc::new(5);

assert_eq!(Ordering::Less, five.cmp(&UniqueRc::new(6)));
```
